description:
David Attenborough's legendary BBC crew explains and shows wildlife all over 

planet earth in 10 episodes. The first is an overview the challenges facing 

life, the others are dedicated to hunting, the deep sea and various major 

evolutionary groups of creatures: plants, primates and other large sections of 

other vertebrates and invertebrates.


